            ICellGetter item,
            FormKey formKey,
            TranslationCrystal? copyMask)
        {
            var newRec = new Cell(formKey, item.FormVersion);
            newRec.DeepCopyIn(item, default(ErrorMaskBuilder?), copyMask);
            return newRec;
        }
        
